(21, 'Bão Trà Mi vào Biển Đông', 9, 14, '<p><font face=\"Arial\">Chiều 24/10, bão Trà Mi vượt qua đảo Luzon của Philippines vào Biển Đông, sức gió mạnh nhất 88 km/h (cấp 9), dự kiến tăng lên ba cấp trong hai ngày tới.</font></p><p><span style=\"font-family: Arial;\">Trung tâm Dự báo Khí tượng Thủy văn quốc gia cho biết lúc 16h, tâm bão trên vùng biển phía đông khu vực Bắc Biển Đông. Bão giữ hướng tây với tốc độ 15-20 km/h, đến 16h ngày mai cách quần đảo Hoàng Sa 610 km, sức gió mạnh nhất cấp 10, giật tăng hai cấp.</span></p><p><span style=\"font-family: Arial;\">Đến 16h ngày 26/10, bão cách quần đảo Hoàng Sa 210 km, sức gió tăng lên cấp 11-12 (tối đa 133 km/h), giữ hướng tây với tốc độ 15-20 km/h. Bão sau đó di chuyển chậm hơn, hơi chúc xuống phía nam và đến ngày 27/10 thì quặt hẳn xuống nam.</span></p><p><span style=\"font-family: Arial;\">Ông Nguyễn Văn Hưởng, Trưởng phòng Dự báo thời tiết, Trung tâm Dự báo Khí tượng Thủy văn quốc gia, nhận định trong 48 giờ bão có xu hướng mạnh dần lên, đạt cực đại cấp 12, giật cấp 15 khi tới khu vực phía Đông quần đảo Hoàng Sa.</span></p><p><span style=\"font-family: Arial;\">\"Sau đó do chịu tác động cùng lúc của không khí lạnh và hoàn lưu bão mới hình thành ngoài khơi phía đông Philippines nên hướng di chuyển của bão sẽ thay đổi bất thường, đặc biệt khi đi qua Hoàng Sa đến ngoài khơi Trung Bộ. Khả năng bão đổ bộ vào đất liền còn chưa rõ ràng, phải theo dõi tiếp\", ông Hưởng nói.</span></p><p style=\"text-align: left;\"><img src=\"data:image/png;base64,\" style=\"width: 100%; float: left;\" data-filename=\"bao-PNG-3658-1729764820.png\"></p><p style=\"text-align: left;\"><br></p><p style=\"text-align: left;\"><br></p><p style=\"text-align: center;\"><font color=\"#222222\" face=\"Arial\"><u>Dự báo hướng đi và vùng ảnh hưởng của bão Trà Mi, chiều 24/10. Ảnh: NCHMF</u></font></p><p><font color=\"#222222\" face=\"Arial\">Đài khí tượng Nhật Bản dự báo bão Trà Mi sẽ đạt sức gió cực đại 108 km/h khi tiến gần vùng biển Trung Trung Bộ. Đài Hong Kong cho rằng gió bão mạnh nhất 120 km/h và ngày 27/10 quay ngược trở ra giữa Biển Đông.</font></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Bão Trà Mi đã gây mưa lớn, ngập lụt nghiêm trọng ở miền bắc Philippines, khiến ít nhất 20 người chết, 47.500 người phải sơ tán, theo AFP. Do ảnh hưởng của bão, hiện vùng biển phía đông khu vực Bắc Biển Đông gió mạnh cấp 7, sau tăng lên cấp 8, vùng gần tâm bão đi qua cấp 9-10 (75-102 km/h), giật cấp 12, sóng biển cao 5-7 m, vùng gần tâm bão 7-9 m. Tàu thuyền hoạt động trong các vùng này có khả năng chịu tác động của giông, lốc, gió mạnh, sóng lớn.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Chủ động cấm biển, rà soát sơ tán dân ở vùng nguy hiểm</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Trong công điện tối 24/10, Thủ tướng Phạm Minh Chính yêu cầu các tỉnh thành ven biển từ Thanh Hóa đến Phú Yên tổ chức theo dõi sát, cập nhật thông tin bão, mưa lũ để triển khai công tác ứng phó, không để bị động, bất ngờ.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Chủ tịch tỉnh thành tổ chức rà soát, kiểm đếm, chủ động hướng dẫn phương tiện đang hoạt động trên biển biết, không đi vào hoặc thoát ra khỏi khu vực nguy hiểm hoặc về nơi tránh trú an toàn; có biện pháp bảo đảm an toàn cho tàu thuyền tại khu neo đậu; căn cứ tình hình cụ thể, chủ động quyết định cấm biển.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Trên đất liền, các địa phương rà soát, sẵn sàng sơ tán người dân ra khỏi khu vực nguy hiểm, nhất là nơi có nguy cơ bị ngập sâu, sạt lở, cửa sông, ven biển; kiểm soát việc đi lại, tổ chức phân luồng, hướng dẫn giao thông, hạn chế người dân ra đường trong thời gian bão đổ bộ, mưa lũ lớn để đảm bảo an toàn.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Với miền núi, Thủ tướng yêu cầu rà soát, sẵn sàng sơ tán dân tại khu vực có nguy cơ ngập sâu, lũ quét, sạt lở đất; chuẩn bị lực lượng, phương tiện, trang thiết bị, nhu yếu phẩm theo phương châm bốn tại chỗ (chỉ huy; lực lượng; phương tiện, vật tư và hậu cần tại chỗ) để sẵn sàng ứng phó với mọi tình huống.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial;\">Trà Mi là cơn bão thứ sáu xuất hiện ở Biển Đông từ đầu năm tới nay. Cơn bão số ba Yagi với sức mạnh siêu bão trên biển và cấp 14, giật 17 khi vào Quảng Ninh ngày 7/9 đã gây gió to, mưa lớn toàn miền Bắc. Bão làm 344 người chết và mất tích, thiệt hại kinh tế hơn 81.000 tỷ đồng.</span></p>', '2024-10-24 15:09:46', '2024-10-25 11:37:39', 0, 'Bão-Trà-Mi-vào-Biển-Đông', '8a8146cf35b8b3f2454a99bc1859f764.png', 7, 'jn_tanh', 'jn_tanh');
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(22, 'Người Việt chi một tỷ USD mua hàng online mỗi tháng', 14, 17, '<p>Doanh số giao dịch trên 5 sàn Shopee, TikTok Shop, Lazada, Tiki và Sendo đạt trung bình 25.300 tỷ đồng (1 tỷ USD) mỗi tháng, với livestream và hàng giá rẻ được ưa chuộng.</p><p>Thông tin mới được công bố trong báo cáo toàn cảnh thị trường sàn bán lẻ trực tuyến quý III của nền tảng dữ liệu thương mại điện tử Metric. Theo đó, tổng doanh số giao dịch (GMV) của 9 tháng đạt 227.700 tỷ đồng, tăng 37,66% so với cùng kỳ 2023.</p><p>Riêng quý III, đóng góp 84.750 tỷ đồng, tăng 18,15% so với quý liền trước, khẳng định sức hấp dẫn và tiềm năng phát triển mạnh mẽ của lĩnh vực thương mại điện tử, theo Metric. Ngoài ra, đây cũng là thời điểm bắt đầu cho mùa cao điểm khuyến mại ngày đôi và các lễ hội kích cầu mua sắm nửa cuối năm.</p><p><img src=\"data:image/png;base64,\" style=\"width: 100%;\" data-filename=\"Screenshot 2024-10-24 221335.png\"></p><p>Thống kê của Metric bao phủ 5 sàn lớn nhất hiện tại là Shopee, TikTok Shop, Lazada, Tiki và Sendo, đã lọc bỏ đơn ảo và sản phẩm quà tặng. Tuy nhiên, chỉ Tiktok Shop và Shopee ghi nhận mức tăng trưởng khả quan so với cả quý II lẫn cùng kỳ 2023. Sau thời gian tăng trưởng âm, Tiki là điểm sáng bất ngờ với GMV quý III phục hồi mạnh mẽ, tăng 38,1% so với quý II, được cho là bước ngoặt khả quan cho nền tảng nội địa.</p><p>Thị trường thương mại điện tử chứng kiến livestream và hàng giá rẻ lên ngôi. Theo Metric, TikTok Shop tăng trưởng GMV cao nhờ hiệu quả của kết hợp giữa mô hình mua sắm và giải trí. Các mùa khuyến mãi lớn ngày đôi, nền tảng này thu hút được nhiều thương hiệu tham gia livestream tần suất cao.</p><p>Ví dụ, trong 9 ngày đầu tháng 9, Bông Bạch Tuyết có hơn 4.000 phiên livestream kết hợp với các Affiliate Creator (nhà sáng tạo nội dung tiếp thị liên kết), ghi nhận doanh thu live chiếm gần 50% trên tổng doanh thu. Mega Sale 6/6, 8/8 và 9/9, KIDO Group tổ chức 4 buổi livestream mỗi ngày, gần 100 phiên mỗi tháng.</p><p>Chỉ trong một ngày đôi 10/10 vừa qua, các phiên livestream của khoảng 100 tài khoản TikTok Shop hàng đầu Việt Nam đã thu hút hơn 11,7 triệu lượt xem, hơn 5,8 triệu người xem duy nhất (unique viewers), gần 500.000 tương tác (engagement), theo thống kê của công ty tiếp thị VeenaMedia và nền tảng công nghệ Stickler.</p><p>Theo Stickler, tỷ trọng bán hàng qua livetream (live commerce) trong tổng thể thương mại điện tử ngày càng lớn, phù hợp xu hướng chung Đông Nam Á. \"Việt Nam là một trong những thị trường live commerce toàn cầu hấp dẫn nhất với tốc độ tăng trưởng dân số lớn, người tiêu dùng trẻ tinh tế và văn hóa yêu thích công nghệ\", ông Fionn Hyndman, Giám đốc điều hành Stickler nói.</p><p>Song song đó, hàng giá rẻ đang trở thành \"cơn sốt\". Theo Metric, thị trường quý III chứng kiến sự gia tăng mạnh mẽ của phân khúc giá rẻ. Các sản phẩm giá dưới 200.000 đồng đã chiếm hơn một nửa tổng doanh số toàn thị trường, với mức tăng 9% thị phần so với năm ngoái.</p><p>Riêng phân khúc dưới 100.000 đồng đã tăng 5% thị phần, trong khi phân khúc từ 100.000 đồng đến 200.000 đồng tăng thêm 4%. \"Điều này cho thấy sức hút lớn của các sản phẩm giá rẻ đối với người tiêu dùng, phản ánh xu hướng tiêu dùng thông minh trong bối cảnh kinh tế vẫn còn nhiều biến động\", báo cáo nhận định.</p><p>Phân khúc giá rẻ càng \"dậy sóng\" khi Temu mở dịch vụ bán hàng tại thị trường Việt Nam từ tháng 10. Dịp chào sân, họ tung ra giảm giá sâu một số mặt hàng để gây chú ý và bạo tay chiết khấu cho tiếp thị liên kết, giới thiệu mở tài khoản.</p><p>Sự hiện diện của Temu nối dài cuộc đổ bộ của các nền tảng thương mại điện tử xuyên biên giới trước đó như Shein, Taobao hay AliExpress, chủ yếu phân phối hàng tận xưởng Trung Quốc. Diễn biến này được cho là có thể gia tăng thêm sức ép cho các nhà sản xuất, bán lẻ nội địa.</p><p>Dự báo cuối năm, Metric cho rằng tổng doanh số trên 5 sàn lớn nhất sẽ khoảng 80.600 tỷ đồng, 870 triệu sản phẩm được tiêu thụ trong quý IV. Tết 2025 diễn ra sớm nên nhu cầu tập trung cao nhất vào cuối tháng 11 và tháng 12. Nhóm mặt hàng tiềm năng tăng mạnh gồm làm đẹp, thời trang, nhà cửa đời sống.</p><p>Phương thức bán hàng qua livestream và giá rẻ vẫn tiếp tục thịnh hành. Theo Metric, sự gia nhập của Temu vào thị trường Việt Nam, cùng với một số động thái từ các sàn thương mại điện tử giá rẻ của Trung Quốc như 1688 và Taobao, đang gia tăng áp lực cạnh tranh.</p><p>Trước đó, thị trường đã chịu sự chi phối mạnh mẽ từ các nền tảng nước ngoài khác như Shopee, Lazada và TikTok Shop. \"Điều này có thể dẫn đến sự cạnh tranh ngày càng khốc liệt, đặc biệt trong phân khúc giá rẻ, khi các sàn mới tiếp tục mở rộng hoạt động và tìm cách thu hút người tiêu dùng Việt Nam\", báo cáo lưu ý.</p><p>Trong khi, livetream vẫn tiếp tục là kênh tiếp cận hiệu quả. Bà Sammy Thủy Phạm, CEO Veena Media, nói những chỉ số thu thập được thông qua 2 chiến dịch ngày đôi là 9/9 và 10/10 cho thấy vẫn còn rất nhiều tiềm năng phát triển nhanh và vững chắc hơn cho thị trường live commerce Việt Nam.</p>', '2024-10-24 15:15:28', '2024-11-09 11:01:08', 1, 'Người-Việt-chi-một-tỷ-USD-mua-hàng-online-mỗi-tháng', 'bacd9d2d53f2ac9bfcc2eba76e586600.jpg', 6, 'jn_tanh', NULL);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(23, 'Người Việt chi 800 tỷ đồng mỗi ngày để mua hàng online', 14, 17, '<p>Dự báo cuối năm, Metric cho rằng tổng doanh số trên 5 sàn lớn nhất sẽ khoảng 80.600 tỷ đồng, 870 triệu sản phẩm được tiêu thụ trong quý IV. Tết 2025 diễn ra sớm nên nhu cầu tập trung cao nhất vào cuối tháng 11 và tháng 12. Nhóm mặt hàng tiềm năng tăng mạnh gồm làm đẹp, thời trang, nhà cửa đời sống.</p><p>Phương thức bán hàng qua livestream và giá rẻ vẫn tiếp tục thịnh hành. Theo Metric, sự gia nhập của Temu vào thị trường Việt Nam, cùng với một số động thái từ các sàn thương mại điện tử giá rẻ của Trung Quốc như 1688 và Taobao, đang gia tăng áp lực cạnh tranh.</p><p>Trước đó, thị trường đã chịu sự chi phối mạnh mẽ từ các nền tảng nước ngoài khác như Shopee, Lazada và TikTok Shop. \"Điều này có thể dẫn đến sự cạnh tranh ngày càng khốc liệt, đặc biệt trong phân khúc giá rẻ, khi các sàn mới tiếp tục mở rộng hoạt động và tìm cách thu hút người tiêu dùng Việt Nam\", báo cáo lưu ý.</p><p>Trong khi, livetream vẫn tiếp tục là kênh tiếp cận hiệu quả. Bà Sammy Thủy Phạm, CEO Veena Media, nói những chỉ số thu thập được thông qua 2 chiến dịch ngày đôi là 9/9 và 10/10 cho thấy vẫn còn rất nhiều tiềm năng phát triển nhanh và vững chắc hơn cho thị trường live commerce Việt Nam.</p><p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot 2024-10-24 221910.png\" style=\"width: 100%; float: left;\"></p><p>Đóng góp chính vào tăng trưởng doanh số kênh trực tuyến đến từ TikTok Shop và Shopee, lần lượt đạt 150,54 % và 65,97% so với cùng kỳ 2023. Theo Metric, điều này là nhờ 2 nền tảng có sự hiểu biết sâu sắc về thị trường và nhu cầu của người tiêu dùng Việt Nam. Trong khi Lazada, Tiki và Sendo chứng kiến chi tiêu của khách hàng giảm 2 con số nửa năm qua.</p><p>Sáu tháng đầu năm, người tiêu dùng mua 1,533 triệu sản phẩm trực tuyến (tính theo đơn nhận thành công), tăng 65,5% so với cùng kỳ 2023. Đáng chú ý, phân khúc giá rẻ dưới 200.000 đồng vẫn duy trì sức hấp dẫn mạnh mẽ, với thị phần tăng thêm 3% so với cùng kỳ.</p><p>\"Với nhiều biến động của tình hình kinh tế hiện nay, thắt chặt chi tiêu vẫn là tiêu chí được nhiều gia đình áp dụng. Vì vậy, người tiêu dùng ưu tiên các sản phẩm có giá cả phải chăng, phù hợp với túi tiền\", báo cáo nhận định.</p><p>Nhờ lợi thế ở phân khúc giá rẻ, nhất là bán khuyến mại qua livestream, tăng trưởng tính theo sản lượng hàng hóa trên TikTok Shop tăng mạnh nhất nửa đầu năm, đến hơn 240% so với cùng kỳ 2023, trong khi Shopee tăng 65,5%.</p><p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot 2024-10-24 222033.png\" style=\"width: 100%;\"></p><p>Tính theo nhóm ngành, người Việt chi tiêu nhiều nhất cho làm đẹp, thời trang nữ và nhà cửa - đời sống trong nửa năm qua. Cả 3 ngành này dẫn đầu về doanh số lẫn sản lượng bán trực tuyến. Tính trung bình mỗi ngày, người Việt chi 144 tỷ đồng cho đồ làm đẹp, hơn 100 tỷ đồng cho quần áo nữ cũng như vật dụng nhà cửa.</p><p>Đi cùng tăng trưởng mạnh mẽ là nhiều thách thức cho người bán lẫn người mua hàng trực tuyến. Google &amp; Temasek dự báo quy mô thương mại điện tử tại Việt Nam đạt 24 tỷ USD vào 2025. Theo chuyên gia Lê Hoàng Long của NielsenIQ Việt Nam, ngành này tăng trưởng nhanh nhưng thay đổi cũng nhanh.</p><p>\"Livestream có thể là động lực cho năm nay và năm tới nhưng môi trường online thay đổi rất nhiều và nhanh nên cần liên tục theo dõi để nắm bắt những thay đổi sắp tới\", ông Long nêu ví dụ trong một sự kiện gần đây.</p><p>Thực tế, các nhà bán hàng đang chịu mức độ cạnh tranh ngày càng cao, nhất là khi nhiều cuộc đua xuống đáy về giá trong các phiên livestream. Chị Nguyễn Huyền Trang, chủ một cửa hàng kinh doanh đồ gia dụng tại TP HCM nói từng đạt đỉnh điểm bán 1.000 đơn mỗi ngày vào tháng 8/2023 nhưng nay chỉ còn 60-70%.</p><p>\"Sụt giảm do nhiều yếu tố, từ xu hướng thắt chặt chi tiêu, khách hàng lựa chọn những sản phẩm giá rẻ hơn, chờ đợi những chương trình khuyến mại hoặc các phiên livestream giá \'sập sàn\'\", chị Trang nói.Kênh online đang ngày càng cạnh tranh khi nhiều thương hiệu chuyển dần từ kênh bán hàng truyền thống sang, sự tham gia của những người nổi tiếng, các nhà xưởng muốn bán trực tiếp cho khách đầu cuối. Chưa kể, trên hầu hết sàn, khách còn có thể mua sản phẩm từ cửa hàng nước ngoài dễ dàng, đa dạng.</p><p>Dữ liệu của Metric cho biết có 573.800 cửa hàng hoạt động trên 5 sàn Shopee, Lazada, Tiki, Sendo và Tiktok Shop trong 6 tháng đầu năm. Ngược với doanh số tăng, lượng cửa hàng giảm 7,54% so với cùng kỳ, cho thấy mức độ cạnh tranh và đào thải cao.</p><p>Với người mua, cơ hội sắm hàng rẻ qua chợ mạng cũng đi kèm rủi ro bị hàng kém chất lượng trà trộn. Nửa năm qua, cơ quan quản lý thị trường đã triệt phá nhiều kho hàng trực tuyến có dấu hiệu bán sản phẩm giả hoặc không rõ nguồn gốc.</p><p>Trong văn bản triển khai cuộc vận động dùng hàng Việt do TP HCM ban hành tháng trước, UBND TP HCM đã yêu cầu Cục quản lý thị trường địa phương \"đặc biệt quan tâm\" kiểm tra, kiểm soát, xử lý các vi phạm trong kinh doanh, mua bán trực tuyến, livestream.</p><p>Hiện một số khách hàng tự chủ động lựa chọn các gian hàng chính hãng (Shop Mall) để mua sắm. Metric cho hay thị phần của Shop Mall nửa năm qua đã tăng 12,29%, cho thấy người tiêu dùng ngày càng ưu tiên lựa chọn các sản phẩm nguồn gốc rõ ràng, nhà bán uy tín.</p>', '2024-10-24 15:21:43', '2024-10-25 11:37:46', 1, 'Người-Việt-chi-800-tỷ-đồng-mỗi-ngày-để-mua-hàng-online', 'b43650c25ebd5c38f3bbae70dfcb4030.png', 4, 'jn_tanh', NULL);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(24, 'Khởi động lại dự án 1.000 tỷ giữa trung tâm Bình Dương', 15, 19, '<p>Dự án gần 20 ha nằm giữa trung tâm TP Thủ Dầu Một được phê duyệt 14 năm trước, sau thời gian dài dừng triển khai vì vướng pháp lý, nay sẽ được khởi động lại.</p><p>Sáng 22/10, trong buổi họp báo kinh tế xã hội 9 tháng đầu năm, đại diện lãnh đạo Sở Kế hoạch đầu tư tỉnh Bình Dương cho biết UBND tỉnh đã phê duyệt điều chỉnh chủ trương đầu tư Khu dân cư Võ Minh Đức từ tháng 8/2024.</p><p>Theo quyết định này thì Quý IV năm 2026 dự án sẽ hoàn tất các thủ tục môi trường, giải phóng mặt bằng và hoàn thành dự án, đưa vào sử dụng vào Quý IV năm 2028.</p><p>Dự án khu dân cư Võ Minh Đức (tên thương mại Central Residence) được UBND tỉnh Bình Dương phê duyệt từ năm 2010 nằm tại phường Chánh Nghĩa, TP Thủ Dầu Một do Công ty Cổ phần Đầu tư xây dựng và kinh doanh bất động sản Thành Nguyên làm chủ đầu tư.</p><p>Dự án khu dân cư có diện tích ban đầu là 19,4 ha, sau đó được điều chỉnh lên 19,7 ha với vốn đầu tư gần 1.000 tỷ đồng với quảng cáo 400 căn nhà phố, biệt thự và 200 căn hộ chung cư.</p><p>Sau khi có chủ trương đầu tư, chủ đầu tư tiến hành đền bù giải phóng mặt bằng 15 ha và đã được UBND tỉnh Bình Dương cấp giấy chứng nhận quyền sử dụng đất cho gần 10 ha. Mặc dù chưa hoàn thiện thủ tục pháp lý và chưa được cấp phép xây dựng, chủ đầu tư vẫn triển khai thi công và bán nhà cho người dân.</p><p>Do xảy ra vi phạm trong thực hiện dự án, cơ quan chức năng xử phạt hành chính và yêu cầu dừng ngay các hoạt động xây dựng trái phép tại dự án. Để đảm bảo tính pháp lý dự án cũng như tránh việc người dân mua nhà đất khi chưa đủ điều kiện, chính quyền địa phương cũng cắm biển cảnh báo người dân về tình trạng pháp lý của dự án và ngăn chặn việc mua bán, chuyển nhượng trái phép.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"5dc3715c0c15b44bed04-2973-1729576221.jpg\"></p><p>Hiện nay khu dân cư có một vài gia đình sinh sống, nhiều dãy nhà phố được chủ đầu tư xây dang dở, xuống cấp, cỏ mọc um tùm. Nhiều tuyến đường, cột điện đầu tư nhiều năm trước cũng hư hỏng nặng.</p>', '2024-10-24 15:24:59', '2024-10-25 02:10:21', 1, 'Khởi-động-lại-dự-án-1.000-tỷ-giữa-trung-tâm-Bình-Dương', 'f8c7618b3a80e25e46ca78a16e91f0e2.jpg', 2, 'jn_tanh', NULL);
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `viewCounter`, `postedBy`, `lastUpdatedBy`) VALUES
(25, 'Nhiều người dừng mua chung cư vì giá cao', 15, 18, '<p>Bất ngờ khi thấy căn chung cư không sổ tăng vọt 300 triệu đồng sau hai tháng, vợ chồng chị Ngọc Vân quyết định dừng kế hoạch mua nhà.</p><p>Sau nhiều năm tích cóp, vợ chồng chị Vân lên kế hoạch mua nhà tại huyện Thanh Trì (Hà Nội) với ngân sách 2 tỷ đồng, trong đó 700 triệu đồng đi vay. Nữ nhân viên công ty vận chuyển cho biết chấp nhận mua cả dự án không có sổ, xa trung tâm với kỳ vọng giá \"mềm\" hơn để sớm có nơi an cư.</p><p>Hỏi mua căn hai phòng ngủ tại Khu đô thị Đại Thanh, chị được môi giới báo giá 2,2 tỷ đồng cho căn diện tích 56 m2 (đơn giá khoảng 39 triệu đồng mỗi m2). Chị bất ngờ vì giá bán này đã chênh thêm 300 trăm triệu so với gần hai tháng trước chị hỏi. Tham khảo thêm quỹ căn chuyển nhượng tại Khu đô thị Thanh Hà Cienco 5, phường Kiến Hưng, quận Hà Đông, chị thấy giá cũng leo thang từ 25-26 triệu đồng một m2 lên 30-31 triệu đồng một m2 sau ba tháng.</p><p>\"Giá quá đắt trong khi nhà lại không sổ, chất lượng xuống cấp nên vợ chồng tôi quyết định dừng mua nhà\", chị cho biết.</p><p>Theo chị Vân, hai vợ chồng lên kế hoạch mua nhà khi mới tích cóp được khoảng 600 triệu đồng cuối năm 2022. Thời điểm đó, chị nhớ, chỉ cần vay thêm 400 triệu, hai người có thể sở hữu căn hai phòng ngủ tại Khu đô thị Đại Thanh. Với kỳ vọng giá nhà hạ nhiệt khi thị trường địa ốc có dấu hiệu đi xuống vào năm 2023, vợ chồng chị đã không xuống tiền mà đợi thêm. Chị chia sẻ \"tiếc nuối\" vì hụt lần mua đó, đến nay giá \"nhảy vọt thêm vài bước\" khiến giấc mơ mua nhà lại bị trì hoãn.</p><p>Tương tự, anh Hải, quê Yên Bái, dự định mua nhà ngày sau khi lấy vợ để gia đình nhỏ sớm có nơi an cư. Gộp cả tiền tiết kiệm và gia đình hai bên hỗ trợ, vợ chồng anh mới có 1,5 tỷ đồng, tính vay thêm để mua một căn hai phòng ngủ tại dự án Rice City Linh Đàm, quận Hoàng Mai.</p><p>Nam nhân viên văn phòng nói, dù canh thời điểm tháng Ngâu, giá bán cũng không có dấu hiệu chững lại. Hỏi nhiều môi giới, anh ngỡ ngàng khi nhà xã hội đã hoạt động chục năm được \"hét\" gần 50 triệu đồng một m2, trong khi giá mở bán chỉ hơn 15 triệu đồng mỗi m2. Để sở hữu một căn hai ngủ, diện tích 58 m2, anh phải chi khoảng 2,8 tỷ đồng. Mức giá này tăng khoảng 40% so với cuối năm ngoái. Gần đây, anh hỏi lại căn trên nhưng môi giới báo \"đã bán, chỉ còn một số căn khác đắt hơn 100-200 triệu đồng\".</p><p>\"Vợ chồng tôi sẽ tiếp tục thuê nhà, đợi giá nhà bớt ảo rồi tính tiếp\", anh nói.</p><p>Anh Hồng Quân, một môi giới chuyên dự án chung cư tại quận Nam Từ Liêm, cho biết trong 6 năm hành nghề, anh gặp không ít trường hợp \"hụt\" mua nhà, nhất là trong thời điểm thị trường tăng nóng. Từ đầu năm đến nay, giá chung cư biến động rõ nét, thậm chí thay đổi theo ngày, theo tuần tại một số dự án khiến nhiều người mua \"ngỡ ngàng\". Môi giới này cho hay, không ít khách hàng của anh cũng chọn tạm dừng mua nhà, chấp nhận \"hụt\" cơ hội an cư vì cho rằng giá tăng vô lý.</p><p>Theo thăm dò mới đây của VnExpress với hơn 7.500 độc giả về kế hoạch mua nhà cuối năm, gần 40% phản hồi cho biết không muốn mua vì giá chung cư quá cao. Ngoài ra, có khoảng 22% độc giả cho biết tiếp tục chọn phương án thuê nhà bởi giá chưa hợp lý.</p><p>Báo cáo quý II của Bộ Xây dựng cũng cho thấy lượng giao dịch chung cư và nhà ở riêng lẻ đã sụt giảm 30% so với đầu năm, do nền giá cao và người mua giữ tâm lý chờ đợi. Giá chung cư leo thang được Bộ Xây dựng đánh giá \"chỉ xảy ra trong một giai đoạn ngắn\" và có dấu hiệu chững lại từ cuối quý II.</p><p>Bà Nguyễn Hoài An, Giám đốc cấp cao CBRE chi nhánh Hà Nội, cho rằng tăng trưởng thu nhập không đuổi kịp đà tăng bất động sản, ảnh hưởng đến khả năng mua nhà. Hiện giá chung cư mới đạt trung bình 64 triệu đồng một m2 (chưa gồm VAT và phí bảo trì) trong quý III, tăng gần 26% theo năm. Dự án sơ cấp tăng cao cũng kéo giá thứ cấp leo thang gần 26% theo năm, đạt 46 triệu đồng một m2.</p><p><img src=\"data:image/png;base64,\" style=\"width: 100%;\" data-filename=\"Screenshot 2024-10-24 222742.png\"></p><p>Trong khi đó, thu nhập trung bình của người lao động tại Hà Nội chỉ tăng khoảng 8% theo năm, đạt 10,7 triệu đồng trong quý III, theo số liệu của Tổng cục Thống kê. Như vậy, một gia đình phải nhịn ăn, nhịn tiêu trong khoảng 12 năm mới đủ tiền mua loại căn hộ giá 3 tỷ đồng, chưa tính đến việc thay đổi giá bất động sản, lạm phát...</p><p>So sánh với Kuala Lumpur, chuyên gia CBRE cho hay giá căn hộ tại Hà Nội ngang Kuala Lumpur (khoảng 66 triệu đồng mỗi m2 đã gồm thuế, phí bảo trì) nhưng thu nhập bình quân đầu người ít hơn 4 lần, cho thấy khả năng mua nhà của người dân Thủ đô thấp hơn. Theo bà An, đà tăng giá nhà bỏ xa tốc độ tăng thu nhập ảnh hưởng đến khả năng chi trả của nhiều gia đình trẻ.</p><p>Ông Nguyễn Văn Đính, Chủ tịch Hội môi giới Bất động sản Việt Nam (VARS), cho biết thị trường bất động sản Hà Nội thời gian qua, từ phân khúc chung cư đến các phiên đấu giá, có dấu hiệu bị đẩy giá cao bất thường, ảnh hưởng đến tâm lý của các chủ thể tham gia thị trường. Vì giá đẩy lên quá cao đến \"bất hợp lý\", theo ông, lượng giao dịch thực tế có dấu hiệu sụt giảm khi ngày càng nhiều người mua không chấp nhận mức tăng đó.</p><p>Theo Chủ tịch VARS, hai giải pháp cần đẩy mạnh là hạn chế nhóm tác nhân đẩy giá bất động sản và tăng nguồn cung nhà ở xã hội nhằm giải bài toán cung - cầu. Trong đó, việc điều tiết thị trường thông qua chính sách thuế bất động sản được ông đánh giá giúp giảm bớt đầu cơ, kiềm chế đà tăng giá nhà đất. Chính sách này cũng khuyến khích chủ sở hữu dự án bỏ hoang cho thuê hoặc bán, tăng thêm nguồn cung ra thị trường.</p><p>Về phân khúc nhà ở xã hội, Chủ tịch VARS cho biết Luật Nhà ở sửa đổi đã mở rộng khả năng tiếp cận nhà ở xã hội cho người dân. Điều quan trọng hiện nay là tăng nguồn cung dự án ra thị trường. Bởi từ đầu năm đến nay, Hà Nội chưa có thêm dự án nhà xã hội nào được khởi công hay hoàn thành, còn TP HCM chỉ mới có thêm một dự án mới được triển khai trong năm nay. Đây cũng là một phần lý do khiến gói 120.000 tỷ đồng cho vay nhà xã hội giải ngân rất chậm, ngoài nguyên nhân lãi suất cao.</p><p>\"Nếu không đẩy mạnh nguồn cung nhà ở xã hội mới, ưu đãi tín dụng hay điều kiện thông thoáng cũng không có nhiều ý nghĩa\", chuyên gia cho hay.</p>', '2024-10-24 15:28:48', '2024-10-25 03:40:29', 1, 'Nhiều-người-dừng-mua-chung-cư-vì-giá-cao', 'b4a0f79f67b2cdd2d182a293c47e203a.jpg', 8, 'jn_tanh', NULL);

